import React from "react";
import ReactDom from "react-dom";
import App from "./App";
import carddetail from "./Array";
 function Cards(){
<>
    {carddetail.map(function(value){
        return(
            <App imsrc={value.imgsrc} name={value.name}/>
        )
    })}
    </>
 } 
 export default Cards;
